// Libraries
import React from 'react'
import PropTypes from 'prop-types'
import classNames from 'classnames'
import _isNil from 'lodash/isNil'

// Components
import { PAYMENT_CATEGORIES, PAYMENT_METHODS } from 'shared/catalogs'
import { prettyDate, getHour } from 'utils'

// Render sigle item
const renderItem = (name, parent, item, isLittle = false) => {
  let renderItem = null
  let content =
    item === 'issue_date'
      ? `${prettyDate(parent[item])} ${getHour(parent[item], true)}`
      : parent[item]
  if (typeof content !== 'undefined' && content !== null) {
    renderItem = (
      <p
        className={classNames('column', {
          'is-one-quarter': isLittle,
          'is-half': !isLittle
        })}
      >
        <label className='caption'>{name}</label>
        <br />
        <span className='body'>{content}</span>
      </p>
    )
  }
  return renderItem
}

// Render invoice if version equals 3.2
const render32 = invoice => {
  let paymentMethod = null
  const sameMethod = method => method.id === invoice.payment_method
  if (!_isNil(invoice.payment_method)) {
    let method = PAYMENT_CATEGORIES.some(sameMethod)
      ? PAYMENT_CATEGORIES.find(sameMethod).label
      : invoice.payment_method
    paymentMethod = (
      <p className='column is-half'>
        <label className='caption'>Método de pago</label>
        <br />
        <span className='body'>{method}</span>
      </p>
    )
  }
  return (
    <div className='columns is-multiline'>
      <p className='column is-12'>
        <label className='caption'>Folio Fiscal</label>
        <br />
        <span className='body'>
          {invoice.digital_tax_stamp ? invoice.digital_tax_stamp.uuid : ''}
        </span>
      </p>
      {renderItem('Fecha de emisión', invoice, 'issue_date')}
      {renderItem('Ubicación de expedición', invoice, 'expedition_location')}
      {renderItem('Versión', invoice, 'version', true)}
      {renderItem('Serie', invoice, 'series', true)}
      {renderItem('Folio', invoice, 'folio', true)}
      {renderItem('Últimos 4 dígitos', invoice, 'last_digits', true)}
      {renderItem('Forma de pago', invoice, 'payment_form')}
      {paymentMethod}
      {renderItem('Folio de impuestos', invoice, 'tax_folio')}
      {renderItem('Serie de impuestos', invoice, 'tax_serie')}
    </div>
  )
}

// Render invoice if version equals 3.3
const render33 = invoice => {
  let paymentForm = !_isNil(invoice.payment_form) ? (
    <p className='column is-half'>
      <label className='caption'>Forma de pago</label>
      <br />
      <span className='body'>
        {
          PAYMENT_CATEGORIES.find(form => form.id === invoice.payment_form)
            .label
        }
      </span>
    </p>
  ) : null
  let paymentMethod = !_isNil(invoice.payment_method) ? (
    <p className='column is-half'>
      <label className='caption'>Método de pago</label>
      <br />
      <span className='body'>
        {PAYMENT_METHODS.find(form => form.id === invoice.payment_method).label}
      </span>
    </p>
  ) : null
  return (
    <div className='columns is-multiline'>
      <p className='column is-12'>
        <label className='caption'>Folio Fiscal</label>
        <br />
        <span className='body'>
          {invoice.digital_tax_stamp ? invoice.digital_tax_stamp.uuid : ''}
        </span>
      </p>
      {renderItem('Fecha de emisión', invoice, 'issue_date')}
      {renderItem(
        'Ubicación de expedición',
        invoice,
        'expedition_location',
        true
      )}
      {renderItem('Versión', invoice, 'version', true)}
      {renderItem('Serie', invoice, 'series', true)}
      {renderItem('Folio', invoice, 'folio', true)}
      {paymentForm}
      {paymentMethod}
      {renderItem('Folio de impuestos', invoice, 'tax_folio')}
      {renderItem('Serie de impuestos', invoice, 'tax_serie')}
    </div>
  )
}

// Main render
const Details = props => {
  let details = (
    <div className='block unselectable'>
      <p>No hay detalles</p>
    </div>
  )
  switch (props.invoice.version) {
    case '3.2':
      details = render32(props.invoice)
      break
    case '3.3':
      details = render33(props.invoice)
      break
  }
  return (
    <div className='column'>
      <h2 className='subheader-green'>Detalles</h2>
      {details}
    </div>
  )
}

Details.propTypes = {
  invoice: PropTypes.shape({
    version: PropTypes.string
  })
}
export default Details
